殺菌成分イソプロピルメチルフェノール配合でニキビのもとになるアクネ菌をしっかり殺菌します。●消炎成分グリチルリチン酸ジカリウム配合でニキビのはれ、赤みを防ぎます。●きめ細かな泡がお肌をしっとりなめらかに洗いあげます。【効能 効果】・ニキビのはれ、赤みをふせぎます。・アクネ菌をしっかり殺菌します。【使用方法】・適量を手にとり、水またはぬるま湯でよく泡立てて洗い、その後よく洗い流してください。【成分】 有効成分・・・グリチルリチン酸ジカリウム、イソプロピルメチルフェノールその他の成分・・・グリセリン、ミリスチン酸、ステアリン酸、ポリエチレングリコール、水酸化K、ラウリン酸、塩化ジメチルジアリルアンモニウム、アクリルアミド共重合体、ジステアリン酸グリコール、セタノール、アルブチン、ビタミンCリン酸Mg、アロエエキス(2)、モモ葉エキス、エタノール、ヒアルロン酸ナトリウム(2)、ヘキサデシロキシPGヒドロキシエチルヘキサデカナミド、L-アルギニン、ツバキ油、エデト酸塩、pH調整剤、粘度調整剤、パラベン、香料 【注意事項】・お肌に異常がある時、またはお肌に合わない時は、ご使用をおやめください。・傷やはれもの、しっしん等の異常がある時はご使用にならないでください。・赤み、はれ、かゆみ、刺激等の異常があらわれた場合は使用を中止し、皮膚科専門医等にご相談ください。そのまま使用を続けますと、症状が悪化することがあります。・乳幼児のいたずらや誤飲に注意し、手の届かないところにおいてください。・目にはいらないように注意してください。【応急処置説明】・目に入ったときは、こすらずにすぐに水かぬるま湯で洗い流してください。異常が残る時は、医師に相談してください。・万一飲み込んだ時は、水や牛乳を飲ませる等の処置をしてください。異常が残る時は、医師に相談してください。 熊野油脂489-0881 愛知県瀬戸市熊野350561-82-9245<br>区分：医薬部外品<br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
